import React, { Component } from 'react';


class FireTypeList extends Component {
	// showProps() {
	// 	console.log(this.props);
	// }
	render() {
		let firePokemon = this.props.pokeData.map(function (poke, index) {
			return (

				<li className="fire">
					<img src={ poke.sprites.front_default } alt={ poke.name } />
					<img src={ poke.sprites.back_default } alt={ poke.name } />
					<strong>{ poke.name }</strong>
					<p>Attribute List</p>
					<ul>
						<li>Weight: { poke.weight }</li>
						<li>Height: { poke.height }</li>
					</ul>

					<p>Stats</p>
					<span>{ poke.stats[0].stat.name }: { poke.stats[0].base_stat }</span><br/>
					<span>{ poke.stats[1].stat.name }: { poke.stats[1].base_stat }</span>
					<span>{ poke.stats[2].stat.name }: { poke.stats[2].base_stat }</span>
				</li>

			);
		})

		return (
			<div>
				<h3>Fire Type</h3>
	        { firePokemon }

	      <hr/>
      </div>
    )
	}
}



export default FireTypeList;
